        </div>,
        <div key="followings">
          팔로잉
          <br />0
        </div>,
        <div key="followings">
          팔로우
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>GG</Avatar>} title="GGyu" />
      <Button onClick={onLogout}>로그아웃</Button>
    </Card>
  );
}

export default UserProfile;
